import React, { Component } from "react";

class Feed extends Component {
  render() {
    return (
      <div key={this.props.id}>
        <h3>{this.props.username}</h3>
        {this.props.curtidas === 1 ? "Curtida" : "Curtidas"} :
        {this.props.curtidas}
        {this.props.comentarios === 1 ? "Comentário" : "Comentários"}:
        {this.props.comentarios}
      </div>
    );
  }
}
export default Feed;
